import React from "react";
import { withCasaVacanzaConsumer } from "../context";
import Loading from "./loading";
import CaseVacanzaFilter from "./CaseVacanzaFilter";
import CaseVacanzaList from "./CaseVacanzaList";

function CaseVacanzaContainer({ context }) {
  const { loading, sortedCaseVacanza, caseVacanza } = context;
  if (loading) {
    return <Loading />;
  }
  return (
    <>
      <CaseVacanzaFilter case={caseVacanza} />
      <CaseVacanzaList case={sortedCaseVacanza} />
    </>
  );
}

export default withCasaVacanzaConsumer(CaseVacanzaContainer);
